const puppeteer = require('puppeteer');
const fs = require('fs');
const path = require('path');

async function subscribeToBuilderMethods() {
    let browser;
    const results = {
        success: false,
        message: '',
        screenshots: []
    };

    try {
        console.log('Launching browser...');
        browser = await puppeteer.launch({
            headless: true,
            args: [
                '--no-sandbox',
                '--disable-setuid-sandbox',
                '--disable-dev-shm-usage',
                '--disable-gpu'
            ]
        });

        const page = await browser.newPage();
        await page.setViewport({ width: 1920, height: 1080 });

        console.log('Navigating to https://buildermethods.com/...');
        await page.goto('https://buildermethods.com/', {
            waitUntil: 'networkidle2',
            timeout: 30000
        });

        console.log('Page loaded. Looking for subscription form...');

        // Wait a moment for any dynamic content to load
        await page.waitForTimeout(2000);

        // Try to find email input fields with various selectors
        const emailSelectors = [
            'input[type="email"]',
            'input[name*="email" i]',
            'input[placeholder*="email" i]',
            'input[id*="email" i]',
            '#email',
            '.email-input',
            '[name="email"]'
        ];

        let emailInput = null;
        for (const selector of emailSelectors) {
            try {
                emailInput = await page.$(selector);
                if (emailInput) {
                    console.log(`Found email input with selector: ${selector}`);
                    break;
                }
            } catch (e) {
                // Continue to next selector
            }
        }

        if (!emailInput) {
            // Take a screenshot to see what's on the page
            const screenshotPath = path.join('/job', 'screenshots', 'buildermethods-no-form-found.png');
            fs.mkdirSync(path.dirname(screenshotPath), { recursive: true });
            await page.screenshot({ path: screenshotPath, fullPage: true });
            results.screenshots.push(screenshotPath);

            // Get page HTML to analyze
            const html = await page.content();
            fs.writeFileSync('/job/tmp/page-content.html', html);

            results.message = 'Could not find email input field. Screenshot saved for inspection.';
            return results;
        }

        // Fill in the email
        console.log('Filling in email: xejeve3197@hutudns.com');
        await emailInput.click();
        await emailInput.type('xejeve3197@hutudns.com', { delay: 50 });

        // Look for submit button
        const submitSelectors = [
            'button[type="submit"]',
            'input[type="submit"]',
            'button:has-text("Subscribe")',
            'button:has-text("Sign up")',
            'button:has-text("Submit")',
            '*[role="button"]:has-text("Subscribe")',
            '.subscribe-button',
            '#subscribe',
            'button'
        ];

        let submitButton = null;
        for (const selector of submitSelectors) {
            try {
                // For text-based selectors, we need a different approach
                if (selector.includes('has-text')) {
                    const buttons = await page.$$('button');
                    for (const button of buttons) {
                        const text = await button.evaluate(el => el.textContent);
                        if (text && (text.toLowerCase().includes('subscribe') || 
                                   text.toLowerCase().includes('sign up') ||
                                   text.toLowerCase().includes('submit'))) {
                            submitButton = button;
                            console.log(`Found submit button with text: ${text}`);
                            break;
                        }
                    }
                    if (submitButton) break;
                } else {
                    submitButton = await page.$(selector);
                    if (submitButton) {
                        console.log(`Found submit button with selector: ${selector}`);
                        break;
                    }
                }
            } catch (e) {
                // Continue to next selector
            }
        }

        if (!submitButton) {
            const screenshotPath = path.join('/job', 'screenshots', 'buildermethods-no-submit-found.png');
            fs.mkdirSync(path.dirname(screenshotPath), { recursive: true });
            await page.screenshot({ path: screenshotPath, fullPage: true });
            results.screenshots.push(screenshotPath);
            results.message = 'Found email field but could not find submit button. Screenshot saved.';
            return results;
        }

        // Take a screenshot before submitting
        const beforeSubmitPath = path.join('/job', 'screenshots', 'buildermethods-before-submit.png');
        fs.mkdirSync(path.dirname(beforeSubmitPath), { recursive: true });
        await page.screenshot({ path: beforeSubmitPath, fullPage: true });
        results.screenshots.push(beforeSubmitPath);
        console.log('Screenshot taken before submission');

        // Click the submit button
        console.log('Clicking submit button...');
        await Promise.all([
            submitButton.click(),
            page.waitForNavigation({ waitUntil: 'networkidle2', timeout: 10000 }).catch(() => {
                // Navigation might not happen for AJAX forms
                console.log('No navigation occurred - likely an AJAX form');
            })
        ]);

        // Wait for any confirmation messages or changes
        await page.waitForTimeout(3000);

        // Take a screenshot of the result
        const afterSubmitPath = path.join('/job', 'screenshots', 'buildermethods-subscription.png');
        await page.screenshot({ path: afterSubmitPath, fullPage: true });
        results.screenshots.push(afterSubmitPath);
        console.log('Screenshot taken after submission');

        // Look for success or error messages
        const pageText = await page.evaluate(() => document.body.innerText);

        if (pageText.toLowerCase().includes('success') || 
            pageText.toLowerCase().includes('thank') ||
            pageText.toLowerCase().includes('subscribed') ||
            pageText.toLowerCase().includes('confirm')) {
            results.success = true;
            results.message = 'Subscription appears successful! Look for confirmation messages on the page.';
        } else if (pageText.toLowerCase().includes('error') || 
                   pageText.toLowerCase().includes('invalid') ||
                   pageText.toLowerCase().includes('already')) {
            results.message = 'Possible error or duplicate subscription detected.';
        } else {
            results.message = 'Form submitted. Please check the screenshot for confirmation.';
        }

        return results;

    } catch (error) {
        console.error('Error during subscription:', error);

        if (browser) {
            try {
                const page = (await browser.pages())[0];
                const errorScreenshotPath = path.join('/job', 'screenshots', 'buildermethods-error.png');
                fs.mkdirSync(path.dirname(errorScreenshotPath), { recursive: true });
                await page.screenshot({ path: errorScreenshotPath, fullPage: true });
                results.screenshots.push(errorScreenshotPath);
            } catch (screenshotError) {
                console.error('Could not take error screenshot:', screenshotError);
            }
        }

        results.message = `Error: ${error.message}`;
        return results;
    } finally {
        if (browser) {
            await browser.close();
        }
    }
}

// Run the subscription
subscribeToBuilderMethods().then(results => {
    console.log('\n=== SUBSCRIPTION RESULTS ===');
    console.log('Success:', results.success);
    console.log('Message:', results.message);
    console.log('Screenshots taken:', results.screenshots.length);
    results.screenshots.forEach(path => console.log('  -', path));

    // Write results to file
    fs.writeFileSync('/job/tmp/subscription-results.json', JSON.stringify(results, null, 2));

    process.exit(results.success ? 0 : 1);
}).catch(error => {
    console.error('Fatal error:', error);
    process.exit(1);
});

